import React, { useState, useEffect } from 'react';
import Navbar from '../Navbar';
import { Link } from 'react-router-dom';
import checkAuth from '../auth/CheckAuth';

function ListIntake() {
  const [intakeData, setIntakeData] = useState({});
  const [pageNumber, setPageNumber] = useState(0);
  const [editDate, setEditDate] = useState(null);
  const [editIntake, setEditIntake] = useState('');
  const user = JSON.parse(localStorage.getItem('loggedInUser')) || { username: '' };

  useEffect(() => {
    const storedData = JSON.parse(localStorage.getItem('intakeData')) || {};
    setIntakeData(storedData[user.username] || {});
  }, [user.username]);

  const handleDelete = (date) => {
    const updatedData = { ...intakeData };
    delete updatedData[date];
    localStorage.setItem('intakeData', JSON.stringify({ [user.username]: updatedData }));
    setIntakeData(updatedData);
    alert('Intake deleted successfully');
  };

  const handleEdit = (date, intake) => {
    setEditDate(date);
    setEditIntake(intake);
  };

  const handleSaveEdit = (date) => {
    const updatedData = { ...intakeData, [date]: { ...intakeData[date], intake: editIntake } };
    localStorage.setItem('intakeData', JSON.stringify({ [user.username]: updatedData }));
    setIntakeData(updatedData);
    setEditDate(null);
  };

  const handleCancelEdit = () => {
    setEditDate(null);
    setEditIntake('');
  };

  const entries = Object.entries(intakeData);
  const pages = Math.ceil(entries.length / 10);
  const paginatedData = entries.slice(pageNumber * 10, (pageNumber + 1) * 10);

  return (
    <div>
      <Navbar />
      <h2>Intake List</h2>
      <table>
        <thead>
          <tr>
            <th>Date</th>
            <th>Intake (ml)</th>
            <th>Time</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {paginatedData.map(([date, { intake, time }]) => (
            <tr key={date}>
              <td>{date}</td>
              <td>
                {editDate === date ? (
                  <input 
                    type="number" 
                    value={editIntake} 
                    onChange={(e) => setEditIntake(e.target.value)} 
                  />
                ) : (
                  intake
                )}
              </td>
              <td>{time}</td>
              <td>
                {editDate === date ? (
                  <>
                    <button onClick={() => handleSaveEdit(date)}>Save</button>
                    <button onClick={handleCancelEdit}>Cancel</button>
                  </>
                ) : (
                  <>
                    <button onClick={() => handleEdit(date, intake)}>Edit</button>
                    <button onClick={() => handleDelete(date)}>Delete</button>
                  </>
                )}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
      <div>
        {pageNumber > 0 && <button onClick={() => setPageNumber(pageNumber - 1)}>Previous</button>}
        {pageNumber < pages - 1 && <button onClick={() => setPageNumber(pageNumber + 1)}>Next</button>}
      </div>
      <Link to="/addintake">Add Intake</Link>
      <Link to="/compareintake">Comparison</Link>
    </div>
  );
}

export default checkAuth(ListIntake);
